  "inlineSchema": "generator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// Enum for User Roles\nenum Role {\n  ADMIN // 전체 관리자\n  SAFETY_TEAM // 안전보건팀 (교육 콘텐츠 관리)\n  TEAM_LEADER // 팀장 (팀원 관리, TBM 작성)\n  WORKER // 일반 작업자 (교육 수강, 서명)\n  OFFICE_WORKER // 사무직 (서명 예외)\n}\n\n// Enum for Action Item Status\nenum ActionStatus {\n  PENDING // 조치 대기\n  IN_PROGRESS // 조치 중\n  COMPLETED // 조치 완료\n  REVIEW // 검토 필요\n}\n\n// Consolidated User Model\nmodel User {\n  id        String   @id @default(uuid())\n  username  String   @unique\n  name      String? // User's full name\n  email     String?  @unique\n  password  String? // Optional for workers without login\n  role      Role     @default(WORKER)\n  site      String? // e.g., Asan, Hwaseong\n  teamId    Int? // Relation to Team\n  createdAt DateTime @default(now())\n\n  team             Team?             @relation(\"TeamMembers\", fields: [teamId], references: [id])\n  ledTeams         Team[]            @relation(\"TeamLeader\") // Back-relation for teams led by this user\n  notices          Notice[]\n  createdApprovals MonthlyApproval[] @relation(\"Approver\")\n  signatures       ReportSignature[]\n  comments         Comment[]\n  reportDetails    ReportDetail[]\n\n  @@index([teamId])\n}\n\nmodel Notice {\n  id             String    @id @default(uuid())\n  title          String\n  content        String\n  authorId       String\n  category       String    @default(\"GENERAL\") // e.g., GENERAL, SAFETY_CHECK_DAY\n  createdAt      DateTime  @default(now())\n  updatedAt      DateTime  @updatedAt\n  isActive       Boolean   @default(true)\n  viewCount      Int       @default(0)\n  imageUrl       String?\n  attachmentUrl  String?\n  attachmentName String?\n  author         User      @relation(fields: [authorId], references: [id])\n  comments       Comment[]\n\n  @@index([authorId])\n}\n\nmodel Comment {\n  id        String   @id @default(uuid())\n  content   String\n  imageUrl  String?\n  authorId  String\n  noticeId  String\n  createdAt DateTime @default(now())\n\n  author User   @relation(fields: [authorId], references: [id], onDelete: Cascade)\n  notice Notice @relation(fields: [noticeId], references: [id])\n\n  @@index([authorId])\n  @@index([noticeId])\n}\n\n// Models for Safety Education (No changes proposed for now)\nmodel Course {\n  id              String           @id @default(uuid())\n  title           String\n  description     String\n  type            String\n  duration        Int\n  videoUrl        String?\n  documentUrl     String?\n  color           String           @default(\"blue\")\n  icon            String\n  isActive        Boolean          @default(true)\n  assessments     Assessment[]\n  certificates    Certificate[]\n  userAssessments UserAssessment[]\n  userProgress    UserProgress[]\n}\n\nmodel UserProgress {\n  id           String   @id @default(uuid())\n  userId       String\n  courseId     String\n  progress     Int      @default(0)\n  completed    Boolean  @default(false)\n  currentStep  Int      @default(1)\n  timeSpent    Int      @default(0)\n  lastAccessed DateTime @default(now())\n  course       Course   @relation(fields: [courseId], references: [id])\n\n  @@index([userId])\n  @@index([courseId])\n}\n\nmodel Assessment {\n  id            String @id @default(uuid())\n  courseId      String\n  question      String\n  options       String\n  correctAnswer Int\n  difficulty    String @default(\"medium\")\n  course        Course @relation(fields: [courseId], references: [id])\n\n  @@index([courseId])\n}\n\nmodel UserAssessment {\n  id             String   @id @default(uuid())\n  userId         String\n  courseId       String\n  score          Int\n  totalQuestions Int\n  passed         Boolean\n  attemptNumber  Int      @default(1)\n  completedAt    DateTime @default(now())\n  course         Course   @relation(fields: [courseId], references: [id])\n\n  @@index([userId])\n  @@index([courseId])\n}\n\nmodel Certificate {\n  id             String   @id @default(uuid())\n  userId         String\n  courseId       String\n  certificateUrl String\n  issuedAt       DateTime @default(now())\n  course         Course   @relation(fields: [courseId], references: [id])\n\n  @@index([userId])\n  @@index([courseId])\n}\n\n// --- TBM & Team Management Models ---\n\nmodel Team {\n  id       Int     @id @default(autoincrement())\n  name     String\n  site     String?\n  leaderId String? // Team Leader\n\n  leader             User?               @relation(\"TeamLeader\", fields: [leaderId], references: [id], onDelete: SetNull, onUpdate: Cascade)\n  members            User[]              @relation(\"TeamMembers\")\n  checklistTemplates ChecklistTemplate[]\n  dailyReports       DailyReport[]\n  monthlyApprovals   MonthlyApproval[]\n\n  @@map(\"Teams\")\n}\n\nmodel ChecklistTemplate {\n  id     Int    @id @default(autoincrement())\n  name   String\n  teamId Int\n\n  team          Team           @relation(fields: [teamId], references: [id], onDelete: Cascade)\n  templateItems TemplateItem[]\n\n  @@index([teamId])\n  @@map(\"ChecklistTemplates\")\n}\n\nmodel TemplateItem {\n  id           Int     @id @default(autoincrement())\n  templateId   Int\n  category     String\n  subCategory  String?\n  description  String\n  displayOrder Int     @default(0)\n\n  template      ChecklistTemplate @relation(fields: [templateId], references: [id], onDelete: Cascade)\n  reportDetails ReportDetail[]\n\n  @@index([templateId])\n  @@map(\"TemplateItems\")\n}\n\nmodel DailyReport {\n  id          Int      @id @default(autoincrement())\n  teamId      Int\n  reportDate  DateTime\n  managerName String? // This could be derived from User going forward\n  remarks     String?\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n  site        String? // e.g., Asan, Hwaseong\n\n  team             Team              @relation(fields: [teamId], references: [id], onDelete: Cascade)\n  reportDetails    ReportDetail[]\n  reportSignatures ReportSignature[]\n\n  @@index([teamId])\n  @@map(\"DailyReports\")\n}\n\nmodel ReportDetail {\n  id         Int     @id @default(autoincrement())\n  reportId   Int\n  itemId     Int\n  checkState String? // \"O\", \"△\", \"X\"\n  authorId   String? // New: User who made this check\n\n  // New fields for photo and action items\n  photoUrl          String?\n  actionDescription String?\n  actionStatus      ActionStatus? @default(PENDING)\n\n  item   TemplateItem @relation(fields: [itemId], references: [id])\n  report DailyReport  @relation(fields: [reportId], references: [id], onDelete: Cascade)\n  author User?        @relation(fields: [authorId], references: [id])\n\n  @@index([reportId])\n  @@index([itemId])\n  @@index([authorId])\n  @@map(\"ReportDetails\")\n}\n\nmodel ReportSignature {\n  id             Int      @id @default(autoincrement())\n  reportId       Int\n  userId         String // Changed to String to match new User model ID\n  signedAt       DateTime @default(now())\n  signatureImage String? // Kept here for historical signatures, new ones can link to User.signature\n\n  report DailyReport @relation(fields: [reportId], references: [id], onDelete: Cascade)\n  user   User        @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@index([reportId])\n  @@index([userId])\n  @@map(\"ReportSignatures\")\n}\n\n// New model for Monthly TBM Approval\nmodel MonthlyApproval {\n  id          String    @id @default(uuid())\n  teamId      Int\n  year        Int\n  month       Int\n  status      String    @default(\"DRAFT\") // DRAFT, SUBMITTED, APPROVED\n  pdfUrl      String?\n  approverId  String?\n  submittedAt DateTime?\n  approvedAt  DateTime?\n\n  team     Team  @relation(fields: [teamId], references: [id])\n  approver User? @relation(\"Approver\", fields: [approverId], references: [id])\n\n  @@unique([teamId, year, month])\n  @@index([teamId])\n  @@index([approverId])\n}\n",
